query:
/*+ NoNestLoop(mc t mk) */ select count(*)
from movie_companies AS mc
inner join title AS t
on t.id = mc.movie_id AND mc.company_id > 149580 AND mc.company_type_id > 1 AND t.kind_id < 7 AND t.production_year = 2006
inner join movie_keyword AS mk
on t.id = mk.movie_id AND mk.keyword_id < 6117;
